import React from "react";
import box from "../components/Careers/CareerBox"

import { useEffect } from "react";
import { useState } from "react";


// https://pastebin.com/raw/xdLmcpTU
const ission = () => {

    const[jobOpening, seteJobOpening] = useState();
    useEffect(() => {
        fetch("https://pastebin.com/raw/xdLmcpTU")
        .then(res => res.json())
        .then(data => {
            seteJobOpening(data);
        })
    })

  return (
    <>
    {jobOpening.map((data) => (
        <h1>{data}</h1>
    ))}
    </>
  );
};

export default mission
